def strip_end_zeros(s):
    return re.sub('000$', '', s.strip())

def strip_to_time(s):
    return re.sub('[^0-9:]', '', s.strip())

def strip_milliseconds(s):
    return re.sub('\..*$', '', s.strip())

def get_milliseconds(s):
    return re.sub('^.*\.', '', s.strip())


